(68, '47455090', 18, 'INGENIERÍA DEL SOFTWARE - ROGER S. PRESSMAN', '1', '<p><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px;\">¿Por qué es importante la ingeniería del software?</span><br style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px;\"><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px;\">Seguro que mucha gente a la que le gusta programar se preguntará y ¿por qué tengo que perder el tiempo haciendo diagramas de clases y diseñando la arquitectura del sistema si yo programo de lujo y mis programas funcionan perfectamente? Seguro que estaremos de acuerdo en que cualquier persona con tiempo y que le guste programar puede hacer software que funcione y sin haber estudiado nada. Sin embargo ese software seguro que es mucho menos eficiente y mucho menos seguro que un software desarrollado usando unos procedimientos adecuados con ayuda de la Ingeniería de Sofware.</span></p><p><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px;\"><br></span><br></p>\r\n<iframe src=\"https://drive.google.com/file/d/1TxETgTfhuVfFM4sfEG2myGgx5vGJRSi7/preview\" width=\"100%\" height=\"880\"></iframe>', '', '', '2019-08-22 19:44:00'),
